import ContactItem from "./ContactItem";

const ContactList = ({ contacts }) => {
  return (
    <div>
      <ul>
        {contacts.map((contact) => (
          <ContactItem name={contact.name} number={contact.number} />
        ))}
      </ul>
    </div>
  );
};

export default ContactList;
